import React from "react";
import Sideheader from "../Sideheader";
import Container from "../Container";
import "./index.css";

export default function SideheaderandContainer({ minimizeSideHeader }) {
  return (
    <div className="sideHeaderAndContainer">
      <Sideheader minimizeSideHeader={minimizeSideHeader} />
      <Container minimizeSideHeader={minimizeSideHeader} hideMainVideoContainer={false} hideSearchcontainer={true}/>
    </div>
  );
}
